import React from "react";
import Pipo from "./Pipo";
import Boy from "./Boy";

function CreateTeen(contact) {
  <Boy contact={contact.name} />;
}

function Person() {
  return <div>{Pipo.map(CreateTeen)}</div>;
}

export default Person;
